import React from "react";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Rent from "../../pages/Rent";
import Login from "../../pages/Login";
import Registration_Customer from "../../pages/Registration_Customer";
import Registration_Rental_Agency from "../../pages/Registration_Rental_Agency";
import { useState } from "react";

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <header>
        <nav class="navbar sticky-nav navbar-expand-md  navbar-light bg-light ml-3 ">
          <div class="container navbar.center .navbar-inner ">
            <div class="collapse navbar-collapse" id="navbarNav">
              <ul class="navbar-nav ms-auto"></ul>
            </div>
          </div>
        </nav>
      </header>
    </div>
  );
}

export default Navbar;
